import React, { useState } from 'react';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';



const Icon = (props) => {

  return (
    <div style={{width: 50, height: 40,margin: 5, fontSize: "0.5em", display: 'inline'}}>
        <FontAwesomeIcon size="sm" {...props} />
    </div>
  );
}

export default Icon;
